  \"Medicare Part D Prescriber Look-up Tool\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  23,\n\t\t\"recent\": 4\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-10-07T14:54:30.448258\",\n\t\"name\": \"medicare-part-d-prescriber-look-up-tool\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This look-up tool is a searchable database
  that allows you to look up a Medicare Part D prescriber by National Provider Identifier
  (NPI), or by name and location. The look-up tool will return information on prescriptions
  provided to and filled by Medicare beneficiaries, including drug name, total number
  of prescriptions dispensed (including original prescriptions and refills) and total
  drug cost. The data covers calendar year 2013 and is based on final-action Part
  D claims for the entire Medicare Part D population. Information is redacted where
  necessary to protect beneficiary privacy.</p>n<p>The database is populated from
  the Medicare Part D Prescriber Public Use File (PUF). Although the Part D Prescriber
  PUF has a wealth of information on payment and utilization for Medicare Part D claims,
  the dataset has a number of limitations. Of particular importance is the fact that
  the data may not be representative of a physicians entire practice as it only includes
  information on beneficiaries enrolled in Medicare Part D prescription drug program.
  In addition, the data are not intended to indicate the quality of care provided.
  To review more information about the Part D Prescriber PUF, please refer to the
  Methodology document.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
